  false,\n\t\"url\": null,\n\t\"notes\": \"Data set contains digital orthophotography.
  The digital orthophotos in this series have a theoretical ground resolution of 0.25
  meter. The digital orthophotos are 4-band in nature (red, green, blue, near infrared)
  and are delivered as flown in four-band .img file format. The four-band imagery
  is delivered in mosaics equaling one eighth of a DOQ. The data set presents information
  that represents current conditions for the specified DOQQ regions of interest as
  specified by PhotoScience Task No. 01012C0053 for coastal areas of South Carolina.
  The project area was selected specifically to cover those sections of the South
  Carolina coastal critical zone where oysters had historically been mapped by SCDNR.
  The extent of the DOQQs for the project area range from the Hilton Head area in
  the southern part of South Carolina to the Myrtle Beach area in the northern part
  of the state. All data were captured during specific imaging windows per contract.
  These imaging windows are 6-10-03 through 6-16-03, 7-9-03 through 7-15-03, 7-30
  through 7-31-03, 8-8-03 through 8-13-03, 8-27-03 through 8-29-03, 9-25-03 through
  9-26-03, 10-24-03 5-2-04 through 5-6-04, 5-16-04 through 5-18-04, 5-31-04 through
  6-5-04, 6-28-04 through 7-4-04, 7-28-04 through 8-2-04, 4-4-05 through 4-11-05,
  and 5-4-05 through 5-8-05. The total DOQQ area is approximately 1,527 square miles.\",\n\t\"owner_org\":
